import React from 'react';
import './App.css';
import Navbar from "./components/Navbar"
import Body from "./components/Body"
import Body2 from "./components/Body2"
import ClassSchedule from './components/ClassSchedule';
import Fitness from './components/Fitness';
import Trainers from './components/Trainers';
import Achievements from './components/Achievements';
import Pricing from './components/Pricing';
import About from './components/About';


const classes = [
  {
    name: 'Yoga',
    time: 'Monday at 7:00am',
    description: 'A relaxing yoga class to start your day.'
  },
  {
    name: 'Spinning',
    time: 'Tuesday at 6:00pm',
    description: 'An intense cardio workout on stationary bikes.'
  },
  {
    name: 'Zumba',
    time: 'Thursday at 5:30pm',
    description: 'A fun and energetic dance workout.'
  }
];



function App() {
  return (
    <div className="App">
      <Navbar />
      <Body />
      <Body2 />
      <Fitness />
      <Trainers />
      <Achievements />
      <Pricing />
      <About />
      <ClassSchedule classes={classes} />

    </div>
  );
}

export default App;
